class Home extends Component {
  render() {
    return (
      <div class="slider">
         <div className = "slides">
              {/* <div className ="slide"> <img src ="./images/gasy.jpeg" alt=""/></div> */}
              <div className ="slide"> <img src ="./images/kely.jpeg" alt=""/></div>
              <div className ="slide"> <img src ="./images/vory.jpeg" alt=""/></div>
           </div>
      </div>

    );
  }
}

export default Home;
